import LoginForm from '../../components/auth/LoginForm';
import './AuthPages.css';

const LoginPage = () => {
  return (
    <div className="auth-page">
      <div className="container">
        <LoginForm />
      </div>
    </div>
  );
};

export default LoginPage;
